import { makeStyles } from "@material-ui/core/styles";

export default makeStyles(() => ({
  radioGroup: {
    display: "flex",
    justifyContent: "center",
    marginBottom: "-10px",
  },
  button: {
    marginTop: "20px",
  },
  input: {
    margin: "auto",
    width: "100%",
    height: "37px",
    borderRadius: "4px",
    border: "None",
    textIndent: "5px",
  },
}));
